import { useState } from 'react';

function Suspense() {

    const [data, setData] = useState(null);

    const handleFetch = () => {
        fetch('/api')
            .then((response) => {
                console.log(response);
                setData(response.json());
            })
            .catch((error) => {
                console.log(error);
            });

    };


    return (
        <div>
            <h2>Suspense</h2>
            <button onClick={handleFetch}>Click to Fetch</button>
            {data ? <p>{data.message}</p> : null}
        </div>
    );
}

export default Suspense;
